import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a product to open detail modal
    await page.waitForSelector('.product-card');
    await page.click('.product-card:first-child');

    // Wait for product modal to appear
    await page.waitForSelector('#productModal', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Wait for and click the Add to Wish List button
    await page.waitForSelector('.add-to-wishlist');
    await page.click('.add-to-wishlist');

    // Wait for success notification
    await page.waitForSelector('.notification.success');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_added.png'));

    // Verify wishlist was updated by checking localStorage
    const wishlist = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonWishlist') || '[]');
    });

    return {
      success: true,
      action: "Added product to wishlist successfully",
      extractedData: {
        wishlistCount: wishlist.length,
        productTitles: wishlist.map(item => item.title)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
